[{"location":"","page":"Home","title":"Home","text":"CurrentModule = ClenshawCurtisBessel","category":"page"},{"location":"#ClenshawCurtisBessel","page":"Home","title":"ClenshawCurtisBessel","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [ClenshawCurtisBessel]","category":"page"},{"location":"#ClenshawCurtisBessel.BrandersPiessensProblem","page":"Home","title":"ClenshawCurtisBessel.BrandersPiessensProblem","text":"Construct a boundary value problem from the modified moment recurrence relation.\n\nN and M correspond to the total number of specified initial boundary conditions, and the number specified on the end of the recurrence, respectively. T is the type we're computing on, a is the parameter in the Bessel function Jᵥ(ax), and ν is the order.\n\n\n\n\n\n","category":"type"},{"location":"#ClenshawCurtisBessel.OliverProblem","page":"Home","title":"ClenshawCurtisBessel.OliverProblem","text":"Construct a boundary value problem from a recurrence relation. The functions for coefficients and the right side dispatch on this abstract type.\n\nN and M correspond to the total number of specified initial boundary conditions, and the number specified on the end of the recurrence, respectively.\n\n\n\n\n\n","category":"type"},{"location":"#ClenshawCurtisBessel.Mₖ_asymptotic-Union{Tuple{T}, Tuple{T,Any,Any}} where T","page":"Home","title":"ClenshawCurtisBessel.Mₖ_asymptotic","text":"Mₖ_asymptotic(a::T, ν, k) where T\n\nComputes a modified moment using asymptotics as k rightarrow infty.\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.OliverP-Tuple{ClenshawCurtisBessel.OliverProblem,Any,Any}","page":"Home","title":"ClenshawCurtisBessel.OliverP","text":"OliverP(OP::OliverProblem, s, i)\n\nComputes P_s(i), the coefficient s at solution index i.\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.OliverP-Union{Tuple{T}, Tuple{ClenshawCurtisBessel.BrandersPiessensProblem{T,N,M} where M where N,Any,Any}} where T","page":"Home","title":"ClenshawCurtisBessel.OliverP","text":"ClenshawCurtisBessel.OliverP(OP::BrandersPiessensProblem{T}, s, k) where T\n\nComputes the modifed moments from Branders & Piessens 1987.\n\nbeginaligned\nfraca^216 M_k(a nu) + left (k+1)^2 - nu^2 - fraca^24 right\nM_k + 2(a nu) + left 4 nu^2 - 2(k+4) + 4 right M_k+3(anu) \n- left 2(k+4)^2 - 6 + 6nu^2 - frac3a^28 right M_k+4(anu) +\n(4nu^2 + 2(k+4) + 4)M_k+5(anu) \n+ left (k+7)^2 - nu^2 - fraca^24 rightM_k+6 + fraca^216 M_k+8(anu) quad = 0\nendaligned\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.OliverR-Tuple{ClenshawCurtisBessel.OliverProblem,Any}","page":"Home","title":"ClenshawCurtisBessel.OliverR","text":"OliverR(OP::OliverProblem, i)\n\nComputes R(i), the right side of the recurrence relation.\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.OliverR-Union{Tuple{T}, Tuple{ClenshawCurtisBessel.BrandersPiessensProblem{T,N,M} where M where N,Any}} where T","page":"Home","title":"ClenshawCurtisBessel.OliverR","text":"OliverR(OP::BrandersPiessensProblem{T}, i)\n\nComputes R(i), the right side of the recurrence relation.\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.assembleP-Union{Tuple{M}, Tuple{N}, Tuple{T}, Tuple{Any,ClenshawCurtisBessel.OliverProblem{T,N,M},Any,Any}} where M where N where T","page":"Home","title":"ClenshawCurtisBessel.assembleP","text":"assembleP{T}(OP::OliverProblem{M,N}, a, b) where {M, N}\n\nGeneric description of the mathbfP matrix within the linear system of Oliver's method. This in equation 3a of Oliver 1968.\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.assembleρ-Union{Tuple{M}, Tuple{N}, Tuple{T}, Tuple{Any,ClenshawCurtisBessel.OliverProblem{T,N,M},Any,Any,Any}} where M where N where T","page":"Home","title":"ClenshawCurtisBessel.assembleρ","text":"assembleρ{T}(OP::OliverProblem{M,N}, a, b) where {M, N}\n\nGeneric description of the vec ho vector within the linear system of Oliver's method. This in equation 3b of Oliver 1968.\n\n\n\n\n\n","category":"method"},{"location":"#ClenshawCurtisBessel.bessel_moment_G-Union{Tuple{T}, Tuple{Any,Any,T}} where T","page":"Home","title":"ClenshawCurtisBessel.bessel_moment_G","text":"bessel_moment_G(λ, ν, a)\n\nComputes the standard Bessel moment G_lambda nu(a) defined as\n\nG_lambda nu(a) = int_0^a t^lambda J_nu(t)dt\n\n\n\n\n\n","category":"method"}]
